        document.addEventListener('DOMContentLoaded', () => {
            // 监听来自主窗口的消息
            window.addEventListener('message', (event) => {
                // 安全性检查：确保消息来自预期的源
                if (event.origin !== window.location.origin) {
                    console.warn("收到来自未知源的消息:", event.origin);
                    return;
                }

                if (event.data && event.data.type === 'BILI_QR_URL') {
                    const qrUrl = event.data.url;
                    if (qrUrl) {
                        // 使用硬编码的纠错级别 4 (H) 来确保健壮性
                        new QRCode(document.getElementById('qrcode'), { text: qrUrl, width: 200, height: 200, colorDark: "#000000", colorLight: "#ffffff", correctLevel: 4 });
                    } else {
                        document.getElementById('qrcode').textContent = '错误：未收到有效的二维码链接。';
                    }
                }
            });
        });
    </script>
